import React from 'react';
import Styles from "./CalculatorBlock.module.scss";

const CalculatorBlock = () => {
    return (
        <div className={Styles.Calculator}>
            <div className={Styles.title}>
                Рассчитайте вашу экономию на ИБ
            </div>
            <div className={Styles.calculate}>
                <div className={Styles.calculate__item}>
                    <div>Сколько сотрудников у вас в компании?</div>
                    <input type={"range"} step={100}    min={0} max={1200}/>
                </div>
            </div>
            <div className={Styles.result}>
                <div>С нами вы сэкономите за год</div>
                <div>1 267 500 ₽*</div>
                <div>*на основе наших данных</div>
            </div>
        </div>
    );
};

export default CalculatorBlock;
